import React from "react";

const OverlayLink = ({ setOpen }) => {
  const openOverlay = () => {
    setOpen(true);
  };
  return (
    <button onClick={() => openOverlay()} className="open-overlay">
      Open Overlay
    </button>
  );
};

export default OverlayLink;
